import React from 'react'

export default function FixedIcons() {
    return (
        <div className="icon-cointainer">
            <a href="https://fontawesome.com/icons/envelope?s=solid" className='linkedIn-icon'><i class="fa-brands fa-linkedin-in"></i>LinkedIn </a>
            <a href="#" className='github-icon'>GitHub<i class="fa-brands fa-github"></i></a>
        </div>
    )
}
